"use strict";var e=require("viem");exports.userAlreadyHasConnectedCoinbaseWallet=t=>{let l=localStorage.getItem("-walletlink:https://www.walletlink.org:Addresses")?.split(" ").filter((t=>e.isHex(t,{strict:!0}))).map((t=>e.getAddress(t)));return!!l?.length&&!!t?.linkedAccounts.filter((e=>"wallet"==e.type&&l.includes(e.address))).length};
